import React, { useState } from 'react';
import Login from './pages/login';
import Notes from './pages/Notes';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);
  return <div>{loggedIn ? <Notes /> : <Login setLoggedIn={setLoggedIn} />}</div>;
}

export default App;
